- input: "TEXT\x1CC00199703\x1C2\x1C\x1CSA11AI\x1C\"This report is amended to remove
    a single receipt of $2,500.00 from the Tennessee Democratic Party which was disclosed
    on page 416 of the original 2007 July Monthly Report.  A review of our reports
    and our bank reconciliations revealed that the funds were never deposited into
    the bank account.  Therefore in order to correct this instance of over-reporting,
    it is necessary to amend this and all subsequent reports to remove the receipt
    and reduce the overall ending balance accordingly.  For the record, this transaction
    involved a non-federal receipt, was caught by our own internal processes, and
    we provide these amended reports voluntarily.  There are no other changes to the
    report.  Please update your records accordingly.\"\n"
